<!DOCTYPE html>
<meta charset="utf-8">
  <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css">

<style type="text/css">
	body {
		background-color: #fff;
		font-family: Sans-serif;
		//text-shadow: 0 0.5px 0 #fff, 0.5px 0 0 #fff, -0.5px 0 0 #fff, 0 -0.5px 0 #fff;
		cursor: default;
	}
	 

	[class*="col-"]{
		padding: 0px;
		margin: 5px auto;
	}

	[class*="col-"] .row{
		margin-right: 0px;
		margin-left: 0px;
	}

	.box{
		//background: #fff;
		margin: 6px;
		padding: 5px 0;
		/*border: 1px solid #d4d4d4;*/
		border-top-color: rgb(204, 204, 204);
		border-top-style: solid;
		border-top-width: 1px;
		border-right-width: 1px;
		border-bottom-width: 1px;
		border-left-width: 1px;
		border-radius: 0 0 4px 4px;
		border-top-left-radius: 0px;
		border-top-right-radius: 0px;
		border-width: 0 0 3px;
		border-top-width: 0px;
		display:block;
		height:100%;
		overflow: hidden;
		animation-duration: 1s;
		animation-name: fadeAndScale;
		animation-timing-function: cubic-bezier(.71,.55,.62,1.57);
	}
	.row-margin {
		margin-top: -8px;
	}
	.title {
		font-size: 15px;
		color: rgba(0,0,0);
		//color: rgba(255,255,255,0.5);
		text-align: left;
		padding-left: 15px;
		font-weight:bold;
		margin-top:10px;
		padding-left: 10px !important;
	}
	.page-title {
		font-size: 18px;
		margin: 0 -10px;
		color: rgba(0,0,0,0.6);
		text-align: left;
	}
	.box .title {
		padding-left: 0px;
	}
	/* Ripple effect */
	.ripple {
		background-position: center;
		transition: background 0.8s;
	}
	.ripple:active {
		background: rgba(0,0,0,0.1) radial-gradient(circle, transparent 1%, rgba(0,0,0,0.1) 1%);
		background-size: 100%;
		transition: background 0s;
	}

	/* Animation effect */
	@keyframes fadeAndScale {
		from {
			opacity: 0;
			transform: scale(.9, .9);
		}
		to {
			opacity: 1;
			transform: scale(1, 1);
		}
	}
	.axis .tick text{
		fill:rgba(0,0,0);
	}
	.axis .tick line{
		stroke:rgba(0,0,0);
	}
	.axis path{
		stroke:rgba(0,0,0);
	}
	.tooltip{
		  position      : absolute;
		  width			: auto;
		  text-align    : center;
		  padding       : 8px;
		  border        : none;
		  border-radius : 8px;
		  background    : rgb(0,0,0,.5);
		  color         : #fff;
		  pointer-events: none;
		  font-size:11px;
	  }
	  #legend {
		position: absolute;
		width: 300px;
		height: 40px;
		text-align: start;
	   margin: 0px auto;
	   z-index: 25;
	   position: absolute;
	   bottom: 30px;
	   right:50px;
	}
	#legendGradient {
		width: 100%;
		height: 15px;
		margin-right:5px;
		//border: 1px solid black;
		left:10px;
	}
</style>

				$('#autoHeight').css('height', windowHeight - '10');
				var boxHeight = 88 * (windowHeight) / 100;
				$('.box').css('height', boxHeight);
			  };
			setHeight();

				noOfLoads=2;
				setHeight();

2.447506,37.721585,0","Name":"Balboa Park (BALB)"},{"Abbreviation":"BAYF","Description":"15242 Hesperian Blvd., San Leandro CA 94578<br />Bay Fair Station provides easy access to Bayfair Center in San Leandro, one of the first shopping centers built in the East Bay.","Location":"-122.126514,37.696924,0","Name":"Bay Fair (BAYF)"},{"Abbreviation":"CAST","Description":"3301 Norbridge Dr., Castro Valley CA 94546<br />Once known for its chicken ranches, Castro Valley was named after Don Guillermo Castro, a local rancher and magistrate in the mid-1800s.","Location":"-122.075602,37.690746,0","Name":"Castro Valley (CAST)"},{"Abbreviation":"CIVC","Description":"1150 Market Street, San Francisco CA 94102<br />Civic Center/UN Plaza Station is nearby some notable San Francisco destinations including including City Hall, War Memorial Opera House, Asian Art Museum, Louise M. Davies Symphony Hall, and the Main Branch of the San Francisco Public Library.","Location":"-122.414123,37.779732,0","Name":"Civic Center/UN Plaza (CIVC)"},{"Abbreviation":"COLS","Description":"7200 San Leandro St., Oakland CA 94621<br />Welcome to Coliseum<br />Coliseum is the transfer Station that connects BART to the Oakland Int'l Airport Station (OAKL). The station is also connected by a pedestrian bridge to the O.co Coliseum and Oracle Arena.","Location":"-122.196869,37.753661,0","Name":"Coliseum/Oakland Airport (COLS)"},{"Abbreviation":"COLM","Description":"365 D Street, Colma CA 94014<br />The Town of Colma is a diverse community on the San Francisco peninsula that maintains that \"small town\" feel despite being so close to major cities. The Colma BART Station is close to residential neighborhoods and shopping areas. Colma is perhaps best known for its 17 cemeteries, which comprise approximately 73% of the town's land area. The town incorporated in 1924 primarily to protect this land use. Colma's cemeteries represent numerous religious beliefs and nationalities, and include structures and districts which are historically significant on local, state and national levels.","Location":"-122.466233,37.684638,0","Name":"Colma (COLM)"},{"Abbreviation":"CONC","Description":"1451 Oakland Avenue, Concord CA 94520<br />Concord is the largest city in Contra Costa County. The Concord BART Station was the \"end of the line\" until 1995 when the line was extended to Pittsburg/Bay Point.","Location":"-122.029095,37.973737,0","Name":"Concord (CONC)"},{"Abbreviation":"DALY","Description":"500 John Daly Blvd., Daly City CA 94014<br />Daly City, located at the northernmost edge of San Mateo County, is often called the \"Gateway to the Peninsula.\"","Location":"-122.469081,37.706121,0","Name":"Daly City (DALY)"},{"Abbreviation":"DBRK","Description":"2160 Shattuck Avenue, Berkeley CA 94704<br />The Downtown Berkeley BART Station is located on Shattuck Avenue between Allston Way and Addison Street. It is conveniently located close to the University of California campus and to many shops, restaurants, theaters and other attractions, and has valet bike parking.","Location":"-122.268133,37.870104,0","Name":"Downtown Berkeley (DBRK)"},{"Abbreviation":"DELN","Description":"6400 Cutting Blvd., El Cerrito CA 94530<br />Sometimes called simply \"del Norte,\" as the name suggests this station serves the northern part of the City of El Cerrito.","Location":"-122.316794,37.925086,0","Name":"El Cerrito del Norte (DELN)"},{"Abbreviation":"DUBL","Description":"5801 Owens Dr., Pleasanton CA 94588<br />This unique station straddles the border of Dublin and Pleasanton on Interstate 580. The station features a number of local and regional bus connections.","Location":"-121.899179,37.701687,0","Name":"Dublin/Pleasanton (DUBL)"},{"Abbreviation":"EMBR","Description":"298 Market Street, San Francisco CA 94111<br />Located in San Francisco's Financial District at the foot of Market Street, Embarcadero Station is close to the Ferry Building, Embarcadero Center, Transbay Terminal and the California Street cable car.","Location":"-122.397020,37.792874,0","Name":"Embarcadero (EMBR)"},{"Abbreviation":"FRMT","Description":"2000 BART Way, Fremont CA 94536<br />Fremont Station is an important regional transfer point for service to AC Transit and Santa Clara Transportation Authority (VTA). The city, and the station, are named for American explorer John Charles Frémont.","Location":"-121.976608,37.557465,0","Name":"Fremont (FRMT)"},{"Abbreviation":"FTVL","Description":"3401 East 12th Street, Oakland CA 94601<br />Originally called \"Fruit Vale,\" the neighborhood around Fruitvale BART Station was mostly apricot and cherry orchards in the late 1800s. Today, it's a vibrant neighborhood and one of Oakland's main commercial areas.","Location":"-122.224175,37.774836,0","Name":"Fruitvale (FTVL)"},{"Abbreviation":"GLEN","Description":"2901 Diamond Street, San Francisco CA 94131<br />The Glen Park neighborhood in San Francisco is nestled in a small valley below Diamond Heights, and BART is at the center of the neighborhood on the corner of Diamond and Bosworth Streets.","Location":"-122.433817,37.733064,0","Name":"Glen Park (GLEN)"},{"Abbreviation":"HAYW","Description":"699 'B' Street, Hayward CA 94541<br />The City of Hayward is known as the \"Heart of the Bay\" for its central and convenient location in Alameda County. Hayward BART Station is near a pedestrian-friendly downtown with a mix of housing, shops, offices and restaurants.","Location":"-122.087018,37.669723,0","Name":"Hayward (HAYW)"},{"Abbreviation":"LAFY","Description":"3601 Deer Hill Road, Lafayette CA 94549<br />Centrally located in the East Bay hills, Lafayette exudes a quiet rural atmosphere and features a distinctive downtown.","Location":"-122.124630,37.893176,0","Name":"Lafayette (LAFY)"},{"Abbreviation":"LAKE","Description":"800 Madison Street, Oakland CA 94607<br />Lake Merritt Station is ideally located near near Oakland Chinatown, Laney College and the Oakland Museum.","Location":"-122.265180,37.797027,0","Name":"Lake Merritt (LAKE)"},{"Abbreviation":"MCAR","Description":"555 40th Street, Oakland CA 94609<br />MacArthur Station is a major BART transfer point near the commercial heart of Temescal, one of north Oakland's oldest neighborhoods.","Location":"-122.267040,37.829065,0","Name":"MacArthur (MCAR)"},{"Abbreviation":"MLBR","Description":"200 North Rollins Road, Millbrae CA 94030<br />Situated on an estate formerly owned by Darius Ogden Mills, this city's name derives from \"Mills\" and the Scottish word \"brae\" or \"rolling hills.\" Today, the Millbrae BART station is the largest intermodal terminal west of the Mississippi, featuring a cross-platform connection to Caltrain.","Location":"-122.386702,37.600271,0","Name":"Millbrae (MLBR)"},{"Abbreviation":"MONT","Description":"598 Market Street, San Francisco CA 94104<br />Located in the heart of San Francisco's Financial District on Market Street, Montgomery Station features excellent access to San Francisco Muni and destinations throughout the city.","Location":"-122.401066,37.789405,0","Name":"Montgomery St. (MONT)"},{"Abbreviation":"NBRK","Description":"1750 Sacramento Street, Berkeley CA 94702<br />North Berkeley Station features a unique circular building and offers easy access to the Ohlone Greenway, an East Bay pedestrian and bicycle path.","Location":"-122.283440,37.873967,0","Name":"North Berkeley (NBRK)"},{"Abbreviation":"NCON","Description":"3700 Port Chicago Highway, Concord CA 94520<br />The North Concord/Martinez station opened December 16, 1995 and briefly served as \"end of the line\" until BART completed the Pittsburg/Bay Point extension over Willow Pass in 1996.","Location":"-122.024653,38.003193,0","Name":"North Concord/Martinez (NCON)"},{"Abbreviation":"OAKL","Description":"1 Airport Drive, Oakland CA 94621<br />Located at the Oakland International Airport, the Oakland Airport station has frequent service to the Coliseum station.","Location":"-122.212191,37.713238,0","Name":"Oakland Airport (OAKL)"}, north and the Coast Range on the west.","Location":"-122.443960,37.664245,0","Name":"South San Francisco (SSAN)"},{"Abbreviation":"UCTY","Description":"10 Union Square, Union City CA 94587<br />Incorporated in 1959, Union City combined the communities of Alvarado, Decoto, and New Haven. Alvarado was the original county seat of Alameda County, and the site of the first county courthouse is a California Historical Landmark.","Location":"-122.017388,37.590630,0","Name":"Union City (UCTY)"},{"Abbreviation":"WARM","Description":"45193 Warm Springs Blvd, Fremont, CA 94539<br />Warm Springs/South Fremont Station is currently the most southern station and is the first station to open on the new San Jose extension.","Location":"-121.939313,37.502171,0","Name":"Warm Springs/South Fremont (WARM)"},{"Abbreviation":"WCRK","Description":"200 Ygnacio Valley Road, Walnut Creek CA 94596<br />The Walnut Creek BART Station is a key piece of infrastructure for a thriving community that can also be characterized as the business and arts center for Contra Costa County.","Location":"-122.067527,37.905522,0","Name":"Walnut Creek (WCRK)"},{"Abbreviation":"WDUB","Description":"6501 Golden Gate Drive, Dublin CA 94568<br />This station straddles the border of Dublin and Pleasanton on Interstate 580 and is near the Stoneridge Shopping Center. It is BART's 44th station.","Location":"-121.928240,37.699756,0","Name":"West Dublin/Pleasanton (WDUB)"},{"Abbreviation":"WOAK","Description":"1451 7th Street, Oakland CA 94607<br />The West Oakland BART Station is located in the West Oakland residential and industrial community. The station serves both local residents and riders from throughout the region with its excellent freeway access and short ride to downtown San Francisco.","Location":"-122.295140,37.804872,0","Name":"West Oakland (WOAK)"}];

<script type="text/javascript">
var selectedData,noOfLoads=1,selectedLeastData;
var update;
function top10stations(json){
	if(update){
		clearInterval(update);
	}
	selectedData=json;
	var width=$('#top10_stations').parent().width();
	var height=$('#top10_stations').parent().height()-$('.title').parent().height();

	var margin = {top: 50, right: 50, bottom: 50, left: 50},
	width =width - margin.left - margin.right,
	height = height - margin.top - margin.bottom - 20;

	var offset = 0;
	 data = [json];


	var color = d3.scaleOrdinal()
	.range(["#cb3f3f","#636363"]);

	var radarChartOptions = {
		margin: margin,
		maxValue: 0.5,
		levels: 5,
		roundStrokes: true,
		color: color,
		opacityCircles: 0.1
	};

RadarChart("#top10_stations", data, radarChartOptions);

function RadarChart(id, data, options) {
	var clicked=false;
	var cfg = {
		w: width,
		h: height,
		margin: margin,
		levels: 3,
		maxValue: 0,
		labelFactor: 1.25,
		wrapWidth: 60,
		opacityArea: 0.35,
		dotRadius: 4,
		opacityCircles: 0.1, 
		strokeWidth: 2,
		roundStrokes: false,
		color: d3.scaleOrdinal(d3.schemeCategory10)
	};

	if('undefined' !== typeof options){
		for(var i in options){
			if('undefined' !== typeof options[i]){ cfg[i] = options[i]; }
		}
	}

	var maxValue = Math.max(cfg.maxValue, d3.max(data, function(i){return d3.max(i.map(function(o){return o.value;}))}));

	var allAxis = (data[0].map(function(i, j){return i.key})),
		total = allAxis.length,
		radius = Math.min(cfg.w/2, cfg.h/2),
		Format = d3.format('.0f'),
		angleSlice = Math.PI * 2 / total;

	var rScale = d3.scaleLinear()
				.range([0, radius])
				.domain([0, maxValue]);

	d3.selectAll(id).html('');

	var svg = d3.select(id)
			.attr("width",  cfg.w + cfg.margin.left + cfg.margin.right)
			.attr("height", cfg.h + cfg.margin.top + cfg.margin.bottom)
			.attr("class", "radar"+id);

	var g = svg.append("g")
		.attr("transform", "translate(" + (cfg.w/2 + cfg.margin.left) + "," + (cfg.h/2 + cfg.margin.top) + ")");

	var filter = g.append('defs').append('filter').attr('id','glow'),
		feGaussianBlur = filter.append('feGaussianBlur').attr('stdDeviation','2.5').attr('result','coloredBlur'),
		feMerge = filter.append('feMerge'),
		feMergeNode_1 = feMerge.append('feMergeNode').attr('in','coloredBlur'),
		feMergeNode_2 = feMerge.append('feMergeNode').attr('in','SourceGraphic');

	var axisGrid = g.append("g").attr("class", "axisWrapper");

	axisGrid.selectAll(".levels")
		.data(d3.range(1,(cfg.levels+1)).reverse())
		.enter()
		.append("circle")
		.attr("class", "gridCircle")
		.attr("r", function(d, i){return radius/cfg.levels*d;})
		.style("fill", "#CDCDCD")
		.style("stroke", "#CDCDCD")
		.style("fill-opacity", cfg.opacityCircles)
		.style("filter" , "url(#glow)");

	axisGrid.selectAll(".axisLabel")
		.data(d3.range(1,(cfg.levels+1)).reverse())
		.enter().append("text")
		.attr("class", "axisLabel")
		.attr("x", 4)
		.attr("y", function(d){return -d*radius/cfg.levels;})
		.attr("dy", "0.4em")
		.style("font-size", "10px")
		.attr("fill", "#222")
		.text(function(d,i) { return Format(maxValue * d/cfg.levels); });

	var axis = axisGrid.selectAll(".axis")
		.data(allAxis)
		.enter()
		.append("g")
		.attr("class", "axis");
	axis.append("line")
		.attr("x1", 0)
		.attr("y1", 0)
		.attr("x2", function(d, i){ return rScale(maxValue*1.1) * Math.cos(angleSlice*i  - Math.PI/2 - offset); })
		.attr("y2", function(d, i){ return rScale(maxValue*1.1) * Math.sin(angleSlice*i  - Math.PI/2 - offset); })
		.attr("class", "line")
		.style("stroke", "lightgrey")
		.style("stroke-width", "1px");

	axis.append("text")
		.attr("class", "legend")
		.style("font-size", "10px")
		.attr("text-anchor", "middle")
		.attr("dy", "0.35em")
		.attr("x", function(d, i){ return rScale(maxValue * cfg.labelFactor) * Math.cos(angleSlice*i  - Math.PI/2 - offset); })
		.attr("y", function(d, i){ return rScale(maxValue * cfg.labelFactor) * Math.sin(angleSlice*i  - Math.PI/2 - offset); })
		.text(function(d){return d})
		.style('fill','#222')
		.call(wrap, cfg.wrapWidth);

	var radarLine = d3.radialLine()
		.curve(d3.curveLinearClosed)
		.radius(function(d) { return rScale(d.value); })
		.angle(function(d,i) {	return i*angleSlice - offset; });


	if(cfg.roundStrokes) {
		radarLine.curve(d3.curveCardinalClosed);
	}

	var blobWrapper = g.selectAll(".radarWrapper")
		.data(data)
		.enter().append("g")
		.attr("class", "radarWrapper");
	
	blobWrapper
		.append("path")
		.attr("class", "radarArea")
		.attr("d", function(d,i) { return radarLine(d); })
		.style("fill", function(d,i) { return cfg.color(i); })
		.style("fill-opacity", cfg.opacityArea)
		.on('mouseover', function (d,i){
			d3.selectAll(".radarArea")
				.transition().duration(200)
				.style("fill-opacity", 0.1); 
			d3.select(this)
				.transition().duration(200)
				.style("fill-opacity", 0.7);
			if(update){
				clearInterval(update);
			}
		})
		.on('mouseout', function(){
			d3.selectAll(".radarArea")
				.transition().duration(200)
				.style("fill-opacity", cfg.opacityArea);
			if(!clicked){
				update=setInterval(animate, 1000);
			}
		})
		.on('click', function(){
			clicked=true;
			if(update){
				clearInterval(update);
			}
		});

	blobWrapper.append("path")
		.attr("class", "radarStroke")
		.attr("d", function(d,i) { return radarLine(d); })
		.style("stroke-width", cfg.strokeWidth + "px")
		.style("stroke", function(d,i) { return cfg.color(i); })
		.style("fill", "none")
		.style("filter" , "url(#glow)");		

	blobWrapper.selectAll(".radarCircle")
		.data(function(d,i) { return d; })
		.enter().append("circle")
		.attr("class", "radarCircle")
		.attr("r", cfg.dotRadius)
		.attr("cx", function(d,i){ return rScale(d.value) * Math.cos(angleSlice*i  - Math.PI/2 - offset); })
		.attr("cy", function(d,i){ return rScale(d.value) * Math.sin(angleSlice*i  - Math.PI/2 - offset); })
		.style("fill", function(d,i,j) { return cfg.color(j); })
		.style("fill-opacity", 0.8);

	blobWrapper
		.append("line")
		.attr("stroke","#636363")
		.attr("stroke-width",1)
		.attr("y2", -radius)
	
	var blobCircleWrapper = g.selectAll(".radarCircleWrapper")
		.data(data)
		.enter().append("g")
		.attr("class", "radarCircleWrapper");
	var tooltip = d3.select(".box")
				.append("div")
				.style("opacity", 0)
				.attr("class", "tooltip")
				.style("padding", "5px");

	var mouseover = function(d) {
		tooltip.style("opacity", 1);
	}
	var mousemove = function(d) {
		tooltip.html("<strong>Station : </strong>"+d.key+
		"<br><strong>Head Count : </strong> " + d.value)
			  .style('left', (d3.event.pageX + 10) + 'px')
				.style('top', (d3.event.pageY - 52) + 'px');
	}
	var mouseleave = function(d) {
		tooltip.style("opacity", 0)
		d3.select(this)
		  .style("stroke", "none")
		  .style("opacity", 0.8)
	}
	blobCircleWrapper.selectAll(".radarInvisibleCircle")
		.data(function(d,i) { return d; })
		.enter().append("circle")
		.attr("class", "radarInvisibleCircle")
		.attr("r", cfg.dotRadius*1.5)
		.attr("cx", function(d,i){ return rScale(d.value) * Math.cos(angleSlice*i  - Math.PI/2 - offset); })
		.attr("cy", function(d,i){ return rScale(d.value) * Math.sin(angleSlice*i  - Math.PI/2 - offset); })
		.style("fill", "none")
		.style("pointer-events", "all")
		.on("mousemove", mousemove)
		.on("mouseleave", mouseleave)
		.on("mouseover", function(d,i) {
			mouseover(d);
			if(update){
				clearInterval(update);
			}
			newX =  parseFloat(d3.select(this).attr('cx')) - 10;
			newY =  parseFloat(d3.select(this).attr('cy')) - 10;

			tooltip
			.attr('x', newX)
			.attr('y', newY)
			.text(Format(d.value))
			.transition().duration(200)
			.style('opacity', 1);
		})
		.on("mouseout", function(){
			if(!clicked){
				update=setInterval(animate, 1000);
			}
			tooltip.transition().duration(200)
			.style("opacity", 0);
		});

	
	function animate() {
		offset+=angleSlice
		blobWrapper.select(".radarArea").transition().attr('transform', 'rotate('+(-offset*180/Math.PI) + ')')
		blobWrapper.select(".radarStroke").transition().attr('transform', 'rotate('+(-offset*180/Math.PI) + ')')

		d3.selectAll(".radarInvisibleCircle").transition().attr("cx", function(d,i){ return rScale(d.value) * Math.cos(angleSlice*i  - Math.PI/2 - offset); }).transition().attr("cy", function(d,i){ return rScale(d.value) * Math.sin(angleSlice*i  - Math.PI/2 - offset); })
		d3.selectAll(".radarCircle").transition().attr("cx", function(d,i){ return rScale(d.value) * Math.cos(angleSlice*i  - Math.PI/2 - offset); }).attr("cy", function(d,i){ return rScale(d.value) * Math.sin(angleSlice*i  - Math.PI/2 - offset); })
		d3.selectAll(".legend tspan").transition().attr("x", function(d, i){ return rScale(maxValue * cfg.labelFactor) * Math.cos(angleSlice*i  - Math.PI/2 - offset); }).attr("y", function(d, i){ return rScale(maxValue * cfg.labelFactor) * Math.sin(angleSlice*i  - Math.PI/2 - offset); })
		
		var currentAngle = (offset) % (Math.PI*2);
		var currentIndex = Math.floor( (currentAngle/(Math.PI*2)) * data[0].length);
		var currentValue = data[0][currentIndex].value;
		//console.log("currentValue",currentValue);
	}

	update=setInterval(animate, 1000);

	function wrap(text, width) {
		text.each(function() {
			var text = d3.select(this),
			words = text.text().split(/\s+/).reverse(),
			word,
			line = [],
			lineNumber = 0,
			lineHeight = 1.4,
			y = text.attr("y"),
			x = text.attr("x"),
			dy = parseFloat(text.attr("dy")),
			tspan = text.text(null).append("tspan").attr("x", x).attr("y", y).attr("dy", dy + "em");

			while (word = words.pop()) {
				line.push(word);
				tspan.text(line.join(" "));
				if (tspan.node().getComputedTextLength() > width) {
					line.pop();
					tspan.text(line.join(" "));
					line = [word];
					tspan = text.append("tspan").attr("x", x).attr("y", y).attr("dy", ++lineNumber * lineHeight + dy + "em").text(word);
				}
			}
		});
	}
}
}
setTimeout(function(){top10stations(intialData)},500);

</script>
<script>
